export const Any_Type = (props) => {
    const typeOf = typeof props;
    console.log(typeof props);
    if (props === '00') {
        return { type: 'NEW_NUMBER', payload:props }
    } else if (typeOf === 'string') {
        return { type: 'NEW_ACTION', payload: props }
    } else {
        return { type: 'NEW_NUMBER', payload: props }
    }
}
